// import { useState, useEffect } from 'react';

const navigation = ({ cast, onChoice }) => {
    return (
        <nav className="columbus">
            <ul>
                <li>
                    <details role="list">
                        <summary role="listitem"> </summary>
                    </details>
                </li>
            </ul>
        </nav>
    )
}

export default navigation;
